import React from 'react'
import {NavLink} from 'reactstrap'

function Login() {
    return(
        <NavLink
        style= {{textDecorationSkip: true, color: 'white'}}
        className="paybutton"
        href='/signup'>
        LOG IN
        </NavLink>
    )
}

export default Signup
